import React from 'react';
import './stylesFiles/Userbox.css';


const UserBoxInfo= ({firstName, lastName, age, gender, value}) =>{
    return(
        <div className="Player_container">
            <div className="Player_photo_list">
                <img src="/Unknown_player.jpg" className="Player_photo"/>
            </div>
            <div className="Player_info">
                <p>
                    {firstName} {lastName}
                    <br/>Age: {age} Gender: {gender}
                    <br/>VALUE: {value}M $
                </p>
            </div>
        </div>
    );
}


export default UserBoxInfo;
